Los parámetros `resolve` y `reject` son funciones que se utilizan para controlar el flujo de ejecución de la promesa. Aunque a menudo se les denomina "callbacks", técnicamente son funciones de retroalimentación (callback functions) ya que se pasan como argumentos a otra función (`Promise`) en lugar de ser pasadas como argumentos a una función de mayor orden.

`resolve` es una función que se utiliza para cumplir con éxito la promesa, es decir, para indicar que la operación asincrónica realizada dentro de la promesa se ha completado exitosamente y devolver un valor. Por lo general, se llama a resolve con el resultado deseado cuando la operación se completa correctamente.

`reject` es una función que se utiliza para rechazar la promesa, es decir, para indicar que la operación asincrónica ha fallado y devolver un motivo de rechazo (generalmente un objeto de error) que describe el motivo del fallo. Por lo general, se llama a reject cuando ocurre un error o una condición no deseada dentro de la promesa.

En resumen, aunque se les llame "callbacks", `resolve` y `reject` son funciones que se utilizan para controlar el flujo de ejecución de una promesa en JavaScript y permiten manejar los resultados exitosos o fallidos de una operación asincrónica dentro de una promesa.

Los hilos (threads) en Java son unidades de ejecución independientes que se ejecutan simultáneamente dentro de un proceso. Esto significa que un proceso puede contener múltiples hilos de ejecución que se ejecutan simultáneamente. Esto permite a los procesos realizar varias tareas al mismo tiempo, como por ejemplo descargar un archivo de internet mientras se ejecuta una aplicación de escritorio.

Los hilos tienen varias funciones básicas en Java. Estas son:

Crear: Esta función crea un nuevo hilo y especifica el código que se ejecutará en el hilo.
Iniciar: Esta función comienza la ejecución de un hilo creado previamente.
Suspender: Esta función suspende la ejecución de un hilo.
Reanudar: Esta función reanuda la ejecución de un hilo suspendido previamente.
Detener: Esta función detiene la ejecución de un hilo.
Unirse: Esta función espera hasta que el hilo en ejecución se complete antes de seguir ejecutando el código.
Un ejemplo de uso de estas funciones es el siguiente:

// Crear un nuevo hilo Thread thread = new Thread(new Runnable(){ public void run() { // Código a ejecutar en el hilo } });

// Iniciar el hilo thread.start();

// Suspender el hilo thread.suspend();

// Reanudar el hilo thread.resume();

// Detener el hilo thread.stop();

// Unirse al hilo thread.join();

Los hilos son otra forma de crear la posibilidad de concurrencia de actividades; sin embargo, la gran diferencia es que los hilos comparten el código y el acceso a algunos datos en forma similar a como un objeto tiene acceso a otros objetos.

Aqui tienes un ejemplo:
```java
//Crea un hilo implementando Runnable.
//Los objetos de MiHilo se pueden ejecutar en sus propios hilos
// porque MiHilo implementa Runnable.
 class MiHilo implements Runnable {
    String nombreHilo;
    MiHilo(String nombre){
        nombreHilo=nombre;
    }
    //Punto de entrada del hilo
    //Los hilos comienzan a ejecutarse aquí
    public void run(){
        System.out.println("Comenzando "+nombreHilo);
        try {
            for (int contar=0; contar<10; contar++){
                Thread.sleep(400);
                System.out.println("En "+nombreHilo+", el recuento "+contar);
            }
        }catch (InterruptedException exc){
            System.out.println(nombreHilo + "Interrumpido.");
        }
        System.out.println("Terminando "+nombreHilo);
    }
}
```

